import Header from "../components/header";
import Main from "../components/main";
import Article from "../components/article";
const Home = () => {
  return (
    <>
      {/* start header with image background */}
      <Header />
      {/* this line the header of page ends  */}
      {/* start main  */}
      <Main />
      {/* end main  */}
      {/* start article */}

      {/* end article */}
      {/* start section */}
      <section>
        <div className="container">
          <div className="element-section">
            <h1>Featured Projects</h1>
            <p>
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras
              ultrices accumsan ornare. Phasellus tristique ullamcorper luctus.
              Nunc varius ullamcorper felis. Nulla nibh ipsum, rutrum.
            </p>
          </div>
        </div>

        <div className="left">
          <h6>Lorem ipsum dolor sit amet, consectetur adipiscing elit. </h6>
          <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras
            ultrices accumsan ornare. Phasellus tristique ullamcorper luctus.
          </p>
          <input type="submit" value="VIEW OUR PROJECTS" />
        </div>
        <img className="right" src="images/Rectangle 10.png" alt="" />
      </section>
      {/* end section */}
      {/* start footer */}
      <footer>
        <p>Copyright 2017. All Rights Reserved.</p>
      </footer>
      {/* end footer */}
    </>
  );
};
export default Home;
